CREATE TABLE medical_devices (
    device_id INT PRIMARY KEY,
    device_name VARCHAR(50),
    device_type VARCHAR(50),
    last_maintenance_date DATE
);

CREATE TABLE maintenance_personnel (
    personnel_id INT PRIMARY KEY,
    personnel_name VARCHAR(50),
    personnel_role VARCHAR(50)
);

CREATE TABLE medical_devices (
  device_id UUID PRIMARY KEY,
  device_name VARCHAR(255),
  manufacturer VARCHAR(255),
  purchase_date DATE
);

CREATE TABLE maintenance_logs (
  log_id UUID PRIMARY KEY,
  schedule_id UUID REFERENCES maintenance_schedules(schedule_id),
  log_date DATE,
  details TEXT
);

CREATE TABLE technicians (
  technician_id UUID PRIMARY KEY,
  technician_name VARCHAR(255),
  specialization VARCHAR(255)
);
